import{_ as l,M as s}from"./chunks/MessageBox.Bt6m6buZ.js";import{c as g,m as o,j as r,a as e,M as a,L as n,o as i}from"./chunks/framework.CcfPirFf.js";const h="/assets/tanghanlin.CV-IoYJO.jpg",d="/assets/nieyuxuan.GrPs7Tzw.jpg",u="/assets/zhumengmeng.OUof4Xzx.jpg",p="/assets/gift.CDN8QuoU.jpg",b="/assets/BIT-1.2C0BV5Ev.png",f="/assets/BIT-2.CV37pOI7.jpg",k=JSON.parse('{"title":"【社区动态】｜第五期启航计划结营啦！⛵️","description":"","frontmatter":{"title":"【社区动态】｜第五期启航计划结营啦！⛵️","date":"2025-7-11","author":{"name":"孙钟恺","github":"sunzhongkai588"},"co_authors":[{"name":"曹莹莹","github":"E-Pudding"}],"category":"community-activity"},"headers":[],"relativePath":"posts/starter-camp-5th.md","filePath":"posts/starter-camp-5th.md"}'),c={name:"posts/starter-camp-5th.md"},x=Object.assign(c,{setup(m){return(_,t)=>(i(),g("div",null,[t[3]||(t[3]=o('<p>从文档深耕到模型适配，2 个月集训见证 29 位新 contributor 蜕变</p><p>在 2025 年 3 月 7 日，飞桨开源社区开启了第五期<strong>启航计划集训营</strong><s>（居然都开了五期了）</s>。经过为期两个月紧张而充实的集训后，启航计划集训营于 5 月 30 日 正式圆满完成所有集训计划。在集训期间，大家出色地完成了三项热身打卡任务，并且有 <strong>29</strong> 位营员合入了 <strong>110</strong> 个 PR。衷心感谢各位营员的积极参与和卓越贡献！ 🎉</p><p>此外，在集训营结尾阶段，我们开放了一、二、三等奖的申请，于 5 月 28 日完成答辩工作，经过 4 名评委的细致评估后，产生了最终获奖名单：</p><ul><li>一等奖：唐汉霖 @<a href="https://github.com/hanlintang" target="_blank" rel="noreferrer">hanlintang</a></li><li>二等奖：聂宇旋 @<a href="https://github.com/Echo-Nie" target="_blank" rel="noreferrer">Echo-Nie</a></li><li>三等奖：朱萌萌 @<a href="https://github.com/594233" target="_blank" rel="noreferrer">594233</a></li></ul><p>💐目前已经公示，详情见：<a href="https://github.com/PFCCLab/Starter/issues/670" target="_blank" rel="noreferrer">https://github.com/PFCCLab/Starter/issues/670</a></p><p>祝贺以上获奖同学 🥳，感谢大家对飞桨开源社区做出的突出贡献～</p><h2 id="听听获奖同学的结营感言" tabindex="-1">听听获奖同学的结营感言 <a class="header-anchor" href="#听听获奖同学的结营感言" aria-label="Permalink to &quot;听听获奖同学的结营感言&quot;">​</a></h2><p>本次启航计划期间，大家都对活动本身以及开源任务等有着自己的感悟和体验，下面我们邀请了一、二、三等奖获奖同学与我们分享他们的参与感受：</p><p><strong>唐汉霖 北京理工大学 计算机学院 计算机科学与技术专业博士生</strong></p>',9)),r(s,null,{default:a(()=>[r(l,{name:"唐汉霖",github:"hanlintang"},{default:a(()=>[...t[0]||(t[0]=[n(" 我在启航计划中主要负责PaddleNLP相关的任务，包括BERT、ERNIE等模型在PaddlePaddle 3.0框架下的新版推理实现，以及部分SLM模型的PIR适配，PaddleNLP大模型套件预训练、微调、对齐和量化的新手文档撰写和示例项目开发。除此之外，还完成了一些文档任务，参与了飞桨0-size Tensor支持以及一些bug修复工作。",-1),e("br",null,null,-1),n(" 这是一次非常宝贵的实践经历，在这个过程里我逐步熟悉了企业中项目开发的版本控制、代码与文档的开发规范、PR提交与审核及CI流程，并在mentor的指导下完成了相应任务。非常感谢飞桨提供的宝贵机会，让我在与老师同学们的交流中对开源和开源社区有了更深入的理解，在开发实践中切实解决了用户的实际问题。未来我将持续精进，为开源社区贡献更多力量。 ",-1),e("p",null,[e("img",{src:h,alt:"tanghanlin"})],-1)])]),_:1})]),_:1}),t[4]||(t[4]=e("p",null,[e("strong",null,"聂宇旋 云南大学软件学院人工智能学院 22 级 软件工程专业 本科生")],-1)),r(s,null,{default:a(()=>[r(l,{name:"聂宇旋",github:"Echo-Nie"},{default:a(()=>[...t[1]||(t[1]=[n(" 在集训期间，我学习了百度飞桨的基础知识与工作流程，并积极参与多个开源任务，包括文档修复、主框架功能补充、Paddle Speech 脚本完善以及 Paddle NLP 文档扩充等。我还处理了多个 Issue 并提交了相应的修复 PR。公司的开发流程更加系统和严谨，特别是在 PR 提交与代码评审方面，是我此前在学校项目中未曾接触过的。这段经历不仅让我熟悉了开源项目的协作机制，也显著提升了我在代码阅读、文档查阅和问题定位方面的能力。",-1),e("br",null,null,-1),n(" 通过实习，我深入了解了 PaddlePaddle 框架的 API 使用规范、脚本编写标准及文档格式要求。从最初对流程较为生疏，到后来能够独立完成任务，我在实践中逐步养成了规范提交 PR 的习惯，并学会了如何高效地与团队成员沟通协作。这段经历让我深刻认识到敢于提问、主动沟通和保持开源热情的重要性，同时也被社区开发者们的高效执行力所激励。此外，担任助教的经历也让我在帮助他人的过程中实现了自我成长，更加理解开源贡献需要深入思考与持续投入，而非仅仅为了完成任务。 ",-1),e("p",null,[e("img",{src:d,alt:"nieyuxuan"})],-1)])]),_:1})]),_:1}),t[5]||(t[5]=e("p",null,[e("strong",null,"朱萌萌 北京理工大学 化学与化工学院 纳米化学硕士研究生")],-1)),r(s,null,{default:a(()=>[r(l,{name:"朱萌萌",github:"594233"},{default:a(()=>[...t[2]||(t[2]=[n(" 启航计划是我参与的第一个开源活动，让注册许久的Github账号终于有了用武之地。在本次集训中，我成功在本地部署了前沿的多模态模型，并将其迁移到PaddlePaddle框架上，完成模型的推理对齐。过程中，百度团队的AIStudio在线编程环境帮了大忙，它让没有团队支持的我，也能有机会学习先进的人工智能知识。这次宝贵的开源经历不仅让我对大模型有了更深入的认识，也极大地提升了我的技术信心——只要热爱，肯钻研，不断寻找解决方法，就能完成任务！",-1),e("br",null,null,-1),n(" 这里有热心伙伴并肩完成开源任务，有礼物奖励顺利结营的参与者，更有活泼又专业的导师在线指导。别担心自己行不行，迈出第一步就知道了！同学们，大胆冲吧！ ",-1),e("p",null,[e("img",{src:u,alt:"zhumengmeng"})],-1)])]),_:1})]),_:1}),t[6]||(t[6]=o('<h2 id="周密的活动安排" tabindex="-1">周密的活动安排 <a class="header-anchor" href="#周密的活动安排" aria-label="Permalink to &quot;周密的活动安排&quot;">​</a></h2><p>本次启航计划集训营为期 2 个月，以双周报提交形式进行阶段性汇报总结。整体的安排节奏如下表，没有参与过启航计划的同学可以留步围观哦~</p><table tabindex="0"><thead><tr><th style="text-align:left;"><strong>时间</strong></th><th style="text-align:left;"><strong>日程</strong></th></tr></thead><tbody><tr><td style="text-align:left;"><strong>2025.3.7</strong></td><td style="text-align:left;">正式启动报名</td></tr><tr><td style="text-align:left;"><strong>2025.3.7 ~ 2025.3.24</strong></td><td style="text-align:left;">持续公开接收简历，确定营员名单</td></tr><tr><td style="text-align:left;"><strong>2025.3.25 19:00</strong></td><td style="text-align:left;">开营仪式，集训正式启动</td></tr><tr><td style="text-align:left;"><strong>2025.3.25 ～ 2025.5.23</strong></td><td style="text-align:left;">参与集训项目（8 weeks）</td></tr><tr><td style="text-align:left;"><strong>2025.5.24 ～ 2025.5.28</strong></td><td style="text-align:left;">申请并完成一、二、三等奖答辩（1 week）</td></tr><tr><td style="text-align:left;"><strong>2025.5.30 23:59</strong></td><td style="text-align:left;">集训营结营，公布考核结果</td></tr></tbody></table><p>为帮助大家更好地入门开发，我们还专门安排了各个方向的快乐开源课题讲解👩🏻‍🏫</p><table tabindex="0"><thead><tr><th><strong>时间</strong></th><th><strong>日程</strong></th></tr></thead><tbody><tr><td><strong>2025.3.27</strong></td><td>PaddleMIX 快乐开源任务讲解 PaddleX 快乐开源任务讲解</td></tr><tr><td><strong>2025.4.10</strong></td><td>PaddleNLP 快乐开源任务讲解发布 Paddle 社区<a href="https://pfcclab.github.io/posts/newcomers-manual" target="_blank" rel="noreferrer">《新人手册》</a></td></tr><tr><td><strong>2025.5.12</strong></td><td>框架方向 3 个新快乐开源任务讲解</td></tr></tbody></table><p>在此期间，我们通过双周周报的形式跟进学员的开发进度。大家可以在每一次周报总结中，及时查缺补漏！当然了，没有按时提交周报的学员，很遗憾地被视为自动退出集训营。（希望本期没有完成任务的同学，下一期再来挑战）</p><p>此外，助教聂师傅 <a href="https://github.com/PFCCLab/Starter/commits?author=Echo-Nie" target="_blank" rel="noreferrer">@Echo-Nie</a> 也会在每个双周周期内收集营员提出的问题，并由助教团队联合飞桨研发团队统一答疑，帮助大家更好地推进项目。</p><table tabindex="0"><thead><tr><th style="text-align:center;"><strong>时间</strong></th><th style="text-align:center;"><strong>日程</strong></th></tr></thead><tbody><tr><td style="text-align:center;"><strong>2025.4.04</strong></td><td style="text-align:center;"><a href="https://github.com/PFCCLab/Starter/issues/537" target="_blank" rel="noreferrer">第一期周报</a> <br><a href="https://github.com/PFCCLab/Starter/blob/main/Reports/season%205/03.25~04.04%E5%91%A8%E6%8A%A5QA.md" target="_blank" rel="noreferrer">第一期周报 QA</a></td></tr><tr><td style="text-align:center;"><strong>2025.4.18</strong></td><td style="text-align:center;"><a href="https://github.com/PFCCLab/Starter/issues/585" target="_blank" rel="noreferrer">第二期周报</a> <br><a href="https://github.com/PFCCLab/Starter/blob/main/Reports/season%205/04.07~04.18%E5%91%A8%E6%8A%A5QA.md" target="_blank" rel="noreferrer">第二期周报 QA</a></td></tr><tr><td style="text-align:center;"><strong>2025.5.04</strong></td><td style="text-align:center;"><a href="https://github.com/PFCCLab/Starter/issues/619" target="_blank" rel="noreferrer">第三期周报</a></td></tr><tr><td style="text-align:center;"><strong>2025.5.16</strong></td><td style="text-align:center;"><a href="https://github.com/PFCCLab/Starter/issues/647" target="_blank" rel="noreferrer">第四期周报</a></td></tr></tbody></table><p>同时，聂师傅也在启航计划的“如流群”中积极回应大家的问题，为同学们提供了及时有效的支持，感谢聂师傅的辛勤付出！</p><p>在集训接近尾声之际，我们组织了一、二、三等奖的评选答辩。共有四位营员主动申请参与报名，并于 5 月 28 日由答辩委员会完成了正式答辩。</p><blockquote><p>答辩详情见：<a href="https://github.com/PFCCLab/Starter/issues/662" target="_blank" rel="noreferrer">答辩安排链接</a></p></blockquote><div style="display:flex;justify-content:space-between;"><figure><img src="'+p+'" alt="gift"><figcaption>结营证书及给力的奖品</figcaption></figure></div><h2 id="一些成果" tabindex="-1">一些成果 <a class="header-anchor" href="#一些成果" aria-label="Permalink to &quot;一些成果&quot;">​</a></h2><p>本次启航计划线上集训营吸引了大量来自五湖四海不同背景的新人加入，同时飞桨开源社区与北京理工大学联动，在北理校园内进行了广泛宣传，许多富有激情的北理同学也通过这个契机成为了飞桨开源社区的开发者。</p><p><strong>数字上的成果</strong></p><ol><li>共有 <strong>29</strong> 位营员合入了 <strong>110</strong> 个快乐开源 PR，涵盖 PaddleSpeech、PaddleNLP、PaddleMIX 等多个开源仓库。</li><li>其中 <strong>28</strong> 名营员首次在飞桨开源仓库中合入 PR，成为飞桨新 contributor。</li><li><strong>12</strong> 名营员满足结营要求，成功通过考核顺利结营，<strong>3</strong> 名优秀营员通过答辩获得一、二、三等奖。</li></ol><h2 id="线下集训营瞬间" tabindex="-1">线下集训营瞬间 <a class="header-anchor" href="#线下集训营瞬间" aria-label="Permalink to &quot;线下集训营瞬间&quot;">​</a></h2><p>本期启航计划集训营还联合北京理工大学开展了线下集训营，期间共有五位来自北理工的同学 @<a href="https://github.com/cszdrg" target="_blank" rel="noreferrer">cszdrg</a>、@<a href="https://github.com/cangtianhuang" target="_blank" rel="noreferrer">cangtianhuang</a>、@<a href="https://github.com/mzj104" target="_blank" rel="noreferrer">mzj104</a>、@<a href="https://github.com/Cutelemon6" target="_blank" rel="noreferrer">Cutelemon6</a>、@<a href="https://github.com/yuwu46" target="_blank" rel="noreferrer">yuwu46</a> 为飞桨 PaddlePaddle 提交了大量高质量的 PR，做出了突出的贡献。</p><p><img src="'+b+'" alt="BIT-1"></p><p><img src="'+f+'" alt="BIT-2"></p><h2 id="最后" tabindex="-1">最后 <a class="header-anchor" href="#最后" aria-label="Permalink to &quot;最后&quot;">​</a></h2><p>🎉恭喜以下所有顺利通过结营考核的营员！你们用实际行动完成了挑战，也为本期启航计划画上了圆满句号：<a href="https://github.com/rich04lin" target="_blank" rel="noreferrer">@rich04lin</a> <a href="https://github.com/cuiyu-ai" target="_blank" rel="noreferrer">@cuiyu-ai</a> <a href="https://github.com/HangFu7" target="_blank" rel="noreferrer">@HangFu7</a> <a href="https://github.com/Echo-Nie" target="_blank" rel="noreferrer">@Echo-Nie</a> <a href="https://github.com/Ismoothly" target="_blank" rel="noreferrer">@Ismoothly</a> <a href="https://github.com/superdonkey007" target="_blank" rel="noreferrer">@superdonkey007</a> <a href="https://github.com/hanlintang" target="_blank" rel="noreferrer">@hanlintang</a> <a href="https://github.com/mayiru1021" target="_blank" rel="noreferrer">@mayiru1021</a> <a href="https://github.com/zhaop-l" target="_blank" rel="noreferrer">@zhaop-l</a>\uFEFF<a href="https://github.com/crashbussy" target="_blank" rel="noreferrer">@crashbussy</a> <a href="https://github.com/lygitgit" target="_blank" rel="noreferrer">@lygitgit</a> <a href="https://github.com/594233" target="_blank" rel="noreferrer">@594233</a></p><p>尽管部分营员由于各种原因未能通过考核，但为我们由衷感谢你们的积极参与，期待你们在飞桨以及其他开源社区中继续取得更进一步的成就。之后可以关注 <a href="https://github.com/orgs/PaddlePaddle/projects/7" target="_blank" rel="noreferrer">https://github.com/orgs/PaddlePaddle/projects/7</a> ，会不定期更新新的开源任务，参与即能锻炼技能，还有机会赢取开源小礼品～ 🏆</p><p>所以，下一期的启航计划，你心动了吗？💓</p>',24))]))}});export{k as __pageData,x as default};
